signatures: >-
  addTableHeader(workSheet: ExcelJS.Worksheet, row: number, col: number,
  columnNames: Array.<string>) : void - Adds a header row with styled column
  names to the specified worksheet.

  addTableRows(workSheet: ExcelJS.Worksheet, startRow: number, startCol: number,
  rows: Array.<Array>, formats?: Array.<string>) : void - Adds rows of data to a
  specified worksheet starting from a given row and column index with optional
  formatting.

  addWorksheet(workbook: ExcelJS.Workbook, sheetName: string) :
  ExcelJS.Worksheet - Adds a new worksheet with the specified name to the
  workbook.

  autoSizeColumnWidth(worksheet: ExcelJS.Worksheet) : void - Adjusts the width
  of worksheet columns to fit their content.

  createWorkbook() : ExcelJS.Workbook - Creates and returns a new Excel
  workbook.

  getBankBranches(bankId: string) : Promise.<Array.<Object>> - Fetches and
  returns branch data for a given bank ID from the FDIC API.

  getBankFinancials(bankId: string) : Promise.<Array.<Object>> - Retrieves and
  returns financial data for a specific bank ID from the FDIC API.

  getBankIdByName(name: string) : Promise.<string> - Retrieves and returns the
  bank ID for a given bank name by querying the FDIC API.
